webpackJsonp([0x93bb84cc84dd],{479:function(e,o){e.exports={pathContext:{docHtml:'<h1 id="workflow-templates"><a href="#workflow-templates" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Workflow Templates</h1>\n<p><img src="/argo/assets/ga.svg" alt="GA"></p>\n<blockquote>\n<p>v2.4 and after</p>\n</blockquote>\n<p>Workflow templates are reusable chunks of YAML that you can use within your workflows. This allows you to have a library of templates.</p>\n<p>You can create some example templates as follows:</p>\n<pre><code>argo template create https://raw.githubusercontent.com/argoproj/argo/master/examples/workflow-template/templates.yaml\n</code></pre>\n<p>The submit a workflow using one of those templates:</p>\n<pre><code>argo submit https://raw.githubusercontent.com/argoproj/argo/master/examples/workflow-template/hello-world.yam\n</code></pre>',docPath:"argo/workflow-templates",proj:"argo"}}}});
